column8:
smarttop(スマートトップ)は本来停車中でなければ開閉が出来ないコンバーチブルトップの開閉を、ゆっくり走行しながら、ワンタッチで開閉させることができます。しかも純正のキーレスリモコンからもワンタッチでルーフの開閉操作を行えます。(※一部車種を除く)<br><br>【特長】：●純正キーレスリモコン操作でコンバーチブルの開閉が可能 ●車両のディスプレイで機能のセットアップ状況を確認 ●ワンタッチオペレーションでコンバーツブルの開閉が可能 ●すべての機能を無効にするパッシブモードを装備 ●走行中開閉可能(30~60km以内) ●プラグイン・インストールで車輌の現状回復も容易 ●日本語取扱説明書付 ●国内正規品<br><br>【注意】 走行中の開閉には速度の制限があります。制限速度はそれぞれの車種により異なります。<br><br>対応車種：2002- メルセデス・ベンツ SL (R230)<br><br>車検対応品<br><br>電装系 | 電装系その他<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


