最近では様々な種類のAV機器やカーナビゲーションなどが当たり前のように自動車に装着されています。また、高出力オーディオなどの想定外の電装品を数多く使用する場合等もあり、その際に生じる電圧低下は燃焼効率の悪化につながります。その結果、燃費の悪化やパワーロスを招いたり、CO2やHC（有害排気ガス）の排出増加の原因となる恐れがあります。ECON（イーコン）を装着することで、イグニッションコイルへの入力電力を純正比＋130％とし、常に安定した電圧供給が可能になり、起こりえる症状を改善することができます。  <br><br>●エンジン型式：3ZR-FE ●排気量（CC）：2000  ●製品構成：ECON本体・車種別専用ハーネス・取付ステー <br><br>【納期】2～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。  <br><br>対応車種：H19/6～ ZRR70/75 ヴォクシー  <br><br>　車検対応品 <br><br>点火系/点火系その他<tr><td colspan="2">
